import axios from 'axios'
import React, {useState, useEffect} from 'react'

export default function Notes() {
  const [notes, setNotes] = useState([])

  useEffect(async() =>
  {
    const res = await axios.get('http://localhost:8000/notes')
    setNotes(res)
  })

  return (
    notes.map(note =>
    {
      return (
        <h2>{note.title} </h2>
      )
    })
  )
}
